  return(
    <div className='book'>
      <h2>{props.name}</h2>
      <p>{props.year}</p>
      <p>{props.price}</p>
    </div>
  );
}

const App = () => {
  return(
    <Book name='JS' year='2019' price='2000'/>
  )
}

